import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
function HomeImg() {
  const [img, setimg] = useState([]);
  const fetchCouses = async () => {
    try {
      const response = await axios.get("http://localhost:3004/homeImg");
      setimg(response.data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchCouses();
  }, []);
  return (
    <div>
      <div className=" relative w-full h-[675px] bg-gray-400">
        <div className=" absolute top-0 w-full h-[675px]">
          <div>
            <link
              rel="stylesheet"
              href="https://fonts.googleapis.com/css2?family=Material+Symbols+Outlined:opsz,wght,FILL,GRAD@24,400,0,0"
            />
          </div>
          <div>
            <div></div>
            <div></div>
          </div>
          <div></div>
        </div>
      </div>
    </div>
  );
}

export default HomeImg;
